import React from "react";

const ProductCard2 = (img, productName, category, oldPrice, price) => {
  return (
    <div>
      <img
        src={img}
        alt={productName}
        className=" h-48 object-cover mb-4 self-center  "
      />
      <div className="flex flex-col justify-between items-center flex-1  ">
        <div>
          <h2 className="text-lg font-bold mt-2">{productName}</h2>
          <p className="line-through text-gray-500">{oldPrice}€</p>
          <p className="text-green-500 text-xl">{price}€</p>
        </div>
        <AddToCartButton label="Add to cart" />
      </div>
    </div>
  );
};

export default ProductCard2;
